function launchNavbar(){let n=document.getElementById("bar-containerJs");n.addEventListener("click",function(){this.classList.toggle("change")})}function areYouSure(){const n=document.querySelectorAll(".delete");for(let t=0;t<n.length;t++)n[t].addEventListener("click",function(n){n.preventDefault();console.log(this.getAttribute("data-confirm"));const t=confirm(this.getAttribute("data-confirm"));if(t){const n=this.getAttribute("href");$.ajax({url:`${n}`,type:"DELETE",success:function(){console.log("Successfully deleted item.");location.reload()},fail:function(t){console.log(`Error while deleting item on ${n}. Error msg: ${t}`)}})}})}